import React from 'react';
import classes from './ReportEntry.module.css';
import Card from '../UI/Card';

function ReportEntry(props)	{
	return (
		<>
			<li>
				<Card className={classes.expense-item}>
					<div className={classes.expense-date}>
						<div className={classes.expense-date__month}>Mar</div>
						<div className={classes.expense-date__year}>2022</div>
						<div className={classes.expense-date__day}>07</div>
					</div>
					<div className={classes.expense-item__description}>
						<h2>{props.Title}</h2>
						<p className={classes.expense-item__price}>$ {props.Price}</p>
					</div>
				</Card>
			</li>
		</>
	)
}

export default ReportEntry;
